import React from 'react';
import logo from './logo.svg';
import './App.css';
import NavBar from './Components/Navbar/NavBar';
import {Animated} from 'react-animated-css'

function App() {
  return (
    <div className="App">
      <Animated animationIn="fadeInDown" animationOut="fadeOutUp" isVisible={true}>
      <NavBar />
      </Animated>
    </div>
  );
}

export default App;
